import { Route, Switch, useHistory,Redirect } from 'react-router-dom'
import './App.css';
import Allproducts from './components/all_products';
import Navbar from './components/navbar';
function App() {
  return (
    <div className="App">
      <Navbar/>
      <Switch>
        {util.isLogged() ? 
        <><Route exact path='/'><Dashboard alluser={alluser} user={user}/></Route>
        <Route exact path='/orders'><Orders user={user}/></Route>
        <Route exact path='/order/:id'><OrederDetails alluser={alluser} user={user}/></Route>
        <Route exact path='/scrapers'><Scraper alluser={alluser} user={user}/></Route>
        <Route exact path='/add_order' component={Add_order} /></> :
        <Redirect to="/login"/>
        }

      </Switch>
      <Allproducts/>
    </div>
  );
}

export default App;
